// create car class (or any other class you like, flowers, houses, movise...);
// the class should have: name, imgSrc (link to an image).
var Movie = /** @class */ (function () {
    function Movie(name, imgSrc) {
        this.name = name;
        this.imgSrc = imgSrc;
    }
    return Movie;
}());
// create an array of this class.
var titanic = new Movie("Titanic", "data:image/jpeg;base64,");
var aladdin = new Movie("Aladdin", "https://resizing.flixster.com/Ka0RFo4qkKvryBBJPgIekMMsiM0=/300x300/v2/https://flxt.tmsimg.com/assets/p14596224_v_v9_al.jpg");
var movise = [titanic, aladdin];
// 1) Render the names on the screen (DOM).
var renderMovie = document.querySelector("#movieNames");
var moviseToHtml = movise
    // 2) Render images and texts to the screen.
    .map(function (Movie) {
    return "<p>\"The movie " + Movie.name + "\" <img src=" + Movie.imgSrc + " />";
})
    .join(" ");
if (renderMovie) {
    renderMovie.innerHTML = moviseToHtml;
}
